import React from 'react';
import { Route, NavLink } from 'react-router-dom';

import NavBar from '../components/NavBar';
import Login from '../components/Login';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      username: '',
      password: '',
      email: ''
    }
  }

  render() {
    return (
      <div>
        Tabless Thursday
        <NavBar />

        <Route 
          path="/login" 
          render={() => {
            <Login 
              {...this.props} 
              username={this.state.username} 
            />}}
        />
      </div>
    );
  }
}

export default App;
